import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <nav>
        <ul>
          <li><Link to="/">Головна</Link></li>
          <li><Link to="/catalog">Каталог</Link></li>
          <li><Link to="/create">Створити машину</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
